import React, { useState } from "react";

function App() {
  const [theme, setTheme] = useState("white");

  const toggleTheme = () => {
    setTheme(theme === "white" ? "black" : "white");
  };

  return (
    <div className="flex justify-center items-center h-screen bg-gray-100">
      <button
        className="px-6 py-3 text-white font-semibold text-lg bg-blue-600 rounded-full shadow-md hover:bg-blue-700 transition-all"
        onClick={toggleTheme}
      >
        Toggle Theme
      </button>
    </div>
  );
}

export default App;
